import React from "react";
import ChannelRow from "./ChannelRow";
import "./SearchPage.css";
import VideoRow from"./VideoRow"
import TuneOutlinedIcon from "@material-ui/icons/TuneOutlined";
function SearchPage() {
    return (
        <div className="searchPage">
            <div className="searchPage__filter">
           <TuneOutlinedIcon/>
           <h2>FILTER</h2>
            </div>
            <hr/>
            <ChannelRow
            image="data:image/jpeg;base64,"
            channel="Clever Programmer"
            verified
            subs="1M"
            noOfVideos={452}
            description="You can find awesome programming videos"
            />
            <hr/>


            <VideoRow
             views="1.8M"
             subs="1M"
             description="A free bootcamp for 5days on react"
             timestamp="1 minute ago"
             channel="clever Programmer"
             title="React Bootcamp"
             image="data:image/jpeg;base64,"
            />
            <VideoRow
             views="1.8M"
             subs="1M"
             description="Building React using Firebase app"
             timestamp="1 minute ago"
             channel="clever Programmer"
             title="Build React Firebase App"
             image="data:image/jpeg;base64,"
             />
             <VideoRow
             views="1.8M"
             subs="1M"
             description="Python Course for beginners"
             timestamp="10 minutes ago"
             channel="clever Programmer"
             title="Python Course"
             image="data:image/jpeg;base64,"
             />
            


        </div>
    );
}

export default SearchPage;

